	addMoreContentHtml: function(presMoreContentHtmlStr)
	{
		// finished on server side; memory issue on iOS7
		// presMoreContentHtmlStr = presMoreContentHtmlStr.replace(/[\r\n]*/ig,'');
		
		this.savedPresContentHtml = presMoreContentHtmlStr;
		this.taskContainerStartTag = this._getNextTaskContainerStartTag( presMoreContentHtmlStr, 0 );
		this._getSlideWrapperStartTags(presMoreContentHtmlStr, this.slideWrapperStartTags);
		
		return this.slideWrapperStartTags.length;
	},
	
	_getHtmlContentForSlide: function(start, end)
	{
		if (start < 1)
			return "";
		if (end > this.slideWrapperStartTags.length)
			return "";
		if (start > end)
			return "";

		var slideContentString = "";
		for (var i=start-1; i < end; i++)
		{
			var slideWrapperId = this.slideWrapperStartTags[i].id;
			slideContentString += this.slideWrapperStartTags[i].text;
			slideContentString += this.drawPageStartTags[slideWrapperId].text;
			slideContentString += '</div>';  // for draw_page
			if ( this.taskContainerStartTags[slideWrapperId] ){
				slideContentString += this.taskContainerContentArray[slideWrapperId];
			}
			slideContentString += '</div>';  // for slideWrapper
			
			// clean redundant string
			if (this.slideWrapperStartTags[i]) {
				this.rsCounter += this.slideWrapperStartTags[i].text.length;
				this.slideWrapperStartTags[i].text = null;  // index will be used
			}
			if (this.drawPageStartTags[slideWrapperId]) {
				this.rsCounter += this.drawPageStartTags[slideWrapperId].text.length;
				this.drawPageStartTags[slideWrapperId] = null;
			}
			if (this.taskContainerStartTags[slideWrapperId]) {
				this.rsCounter += this.taskContainerStartTags[slideWrapperId].text.length;
				this.taskContainerStartTags[slideWrapperId] = null;
			}
			if (this.taskContainerContentArray[slideWrapperId]) {
				this.rsCounter += this.taskContainerContentArray[slideWrapperId].length;
				this.taskContainerContentArray[slideWrapperId] = null;
			}
		}
		
		return slideContentString;
	},
	
	createSlideContent: function(start, end) {
		// check
		if (start < 1)
			return;
		if (end > this.slideWrapperStartTags.length)
			return;
		if (start > end)
			return;
		
		// loop
		
		var slideContentEndIndex;
		var drawPageContent;
		
		for(var i=start-1; i<end; i++){
			var tag = this.slideWrapperStartTags[i];
			var slideContent;
			var slideWrapperId = tag.id;
			var drawPageStartTag = this._getNextDrawPageStartTag( this.savedPresContentHtml, tag.index );
			var drawPageContentStartIndex = drawPageStartTag.index + drawPageStartTag.text.length;
			var slideId = drawPageStartTag.id;
			this.drawPageStartTags[ slideWrapperId ] = drawPageStartTag;
			
			if (this.taskContainerStartTag && this._isTaskBetweenCurrentAndNext(tag, this.slideWrapperStartTags[i + 1], this.taskContainerStartTag.index)){
				this.taskContainerStartTags[ slideWrapperId ] = this.taskContainerStartTag;
				this.taskContainerStartTag = this._getNextTaskContainerStartTag( this.savedPresContentHtml, this.slideWrapperStartTags[i + 1].index );
			}				
			
			if ( i != (this.slideWrapperStartTags.length - 1)){
				slideContentEndIndex = this.slideWrapperStartTags[ i + 1].index;
			} else {
				slideContentEndIndex = this._getLastSlideWrapperIndex(this.savedPresContentHtml, tag.index);
				if ( this.taskContainerStartTag){
					this.taskContainerStartTags[ slideWrapperId ] = this.taskContainerStartTag;
					this.taskContainerContentArray[ slideWrapperId] = this._deleteLastDiv(this.savedPresContentHtml.substring(  this.taskContainerStartTags[ slideWrapperId ].index, slideContentEndIndex));
				}
			}
			
			if ( this.taskContainerStartTags[ slideWrapperId ] ){
				drawPageContent = this._deleteLastDiv(this.savedPresContentHtml.substring( drawPageContentStartIndex , this.taskContainerStartTags[ slideWrapperId ].index));
				this.drawPageContentArray [ slideWrapperId] = drawPageContent;
				this.taskContainerContentArray[ slideWrapperId] = this._deleteLastDiv(this.savedPresContentHtml.substring(  this.taskContainerStartTags[ slideWrapperId ].index, slideContentEndIndex));
			} else {
				drawPageContent = this._deleteLastThreeDivs(this.savedPresContentHtml.substring( drawPageContentStartIndex, slideContentEndIndex));
				this.drawPageContentArray [ slideWrapperId] = drawPageContent;
			}
			
			// slideContent = new concord.widgets.SlideContent(drawPageContent, slideWrapperId, false, false, this.savedPresContentHtml.substring( this.slideWrapperStartTags[i].index, slideContentEndIndex ));
			slideContent = new concord.widgets.SlideContent(drawPageContent, slideId, false, false);
			
			// this.slideContentArray[slideId] = slideContent;
			this.slideContentArray.push(slideContent);
			this.totalSlideNum++;
			
			// clean redundant string
			if (this.drawPageContentArray[slideWrapperId]) {
				this.rsCounter += this.drawPageContentArray[slideWrapperId].length;
				this.drawPageContentArray[slideWrapperId] = null;
			}
		}
	},
	
	/*
	 * populate the slide content array from presContentHtml
	 * @param presContentHtmlStr
	 */
	populateSlideContentArray: function(presContentHtmlStr){
		if(presContentHtmlStr!=null){
			// strip out carrige return and line feed chars.
			// finished on server side; memory issue on iOS7
			// presContentHtmlStr = presContentHtmlStr.replace(/[\r\n]*/ig,'');  
			
			this.savedPresContentHtml = presContentHtmlStr;

			this.taskContainerStartTag = this._getNextTaskContainerStartTag( presContentHtmlStr, 0 );
			this.slideWrapperStartTags = this._getSlideWrapperStartTags(presContentHtmlStr);
		}
	},
	
	/*
	 * clean the redundant string after loading finished
	 */
	cleanRedundantString: function() {
		// reset the member for loading
		this.slideWrapperStartTags = [];
		this.drawPageContentArray = [];
		this.drawPageStartTags = [];
		this.taskContainerStartTags = [];
		this.taskContainerContentArray = [];
		
		if (this.savedPresContentHtml) {
			this.rsCounter += this.savedPresContentHtml.length;
			this.savedPresContentHtml = null;
		}
		
		if (this.taskContainerStartTag) {
			this.rsCounter += this.taskContainerStartTag.text.length;
			this.taskContainerStartTag = null;
		}

		return this.rsCounter;
	},
	
	/*
	 * add slide content html to the slideContentArray
	 */
	addSlideContent: function(slideContentHtmlStr, slideId, isLoaded, wasLoaded){
		if(slideContentHtmlStr!=null && slideId !=null){
			if(wasLoaded == null){
				wasLoaded = isLoaded;
			}
			var slideContent = new concord.widgets.SlideContent(slideContentHtmlStr, slideId, isLoaded, wasLoaded);
			// this.slideContentArray[slideId] = slideContent;
			this.slideContentArray.push(slideContent);
			this.totalSlideNum++;
		}
	},
	
	/*
	 * delete slide content html from the slideContentArray
	 */
	deleteSlideContent:function (slideId) {
		if (slideId!=null && slideId.length>0) {
			
			for (var i=0; i < this.slideContentArray.length; ++i) {
				if (this.slideContentArray[i]!=null && 
					this.slideContentArray[i].slideId==slideId) {
					var slideContent = this.slideContentArray[i];
					this.slideContentArray[i] = null;
					delete slideContent;
					this.totalSlideNum--;
					
					window['pe'].scene.slideNodeLockStatusRemoveEntry(slideId);
					return;
				}
			} // end for
			
		}
	},
	
	/*
	 * get slide content by slideId
	 */
	getSlideContent:function (slideId) {
		if (slideId!=null && slideId.length>0) {
			for (var i=0; i < this.slideContentArray.length; ++i) {
				if (this.slideContentArray[i]!=null && 
					this.slideContentArray[i].slideId==slideId) {
					
					return this.slideContentArray[i];
				}
			} // end for
		}
		
		return null;
	},
	
