	_getSlideWrapperStartTags: function( presContentHtmlStr, targs ) {
		var slideWrapperStartTags = targs? targs : [];

		var tagRegexp =/<\s*div[^<]*\s*class\s*=\s*['"][^<]*slideWrapper[^<]*['"][^<]*>/ig;
		tagRegexp.lastIndex = 0;
		var match = tagRegexp.exec(presContentHtmlStr);
		while (match != null) {
			var nodeText = match[0];
			var tag = { id: this._getIdFromStartNode( nodeText),
						text: nodeText,
						index: match.index
					};
			slideWrapperStartTags.push(tag);
			match = tagRegexp.exec(presContentHtmlStr);
		}
		return slideWrapperStartTags;
	},	
	
	_getNextDrawPageStartTag: function( htmlString, index){
		var tagRegexp =/<\s*div[^<]*\s*class\s*=\s*['"][^<]*draw_page[^<]*['"][^<]*>/ig;
	    tagRegexp.lastIndex = index;
	    var match = tagRegexp.exec( htmlString);
	    if ( match){
	        var nodeText = match[0];
	        return {id: this._getIdFromStartNode(nodeText),
	        		text: nodeText,
	                index: match.index };
	    }
	},
	
	_getNextTaskContainerStartTag: function( htmlString, index){
		var tagRegexp =/<\s*div[^<]*\s*class\s*=\s*['"][^<]*taskContainer[^<]*['"][^<]*>/ig;
	    tagRegexp.lastIndex = index;
	    var match = tagRegexp.exec( htmlString);
	    if ( match){
	        var nodeText = match[0];
	        return { text: nodeText,
	                index: match.index };
	    } else {
	        return null;
	    }
	},	
	
	_getIdFromStartNode: function ( htmlTag){
		var tagRegexp =/<\s*div[^<]*\s+id=['"]*([a-zA-Z0-9\.`!@#$%\^&\*(){}_\+=\-|\\]+)['"]*[^<]*>/ig;
		tagRegexp.lastIndex = 0;
		var match = tagRegexp.exec(htmlTag);
		if ( match){
			return match[1];
		} else {
            return null;
        }
	},
	
	_getLastSlideWrapperIndex: function ( presContentHtmlStr, secondLastIndex){
		var finalIndex = presContentHtmlStr.length;
		var tagRegexp =/<\/*div[^<]*>\s*[^<]*<\/*div[^<]*>\s*<\/body>\s*<\/html>\s*/ig;
		var tempStore = this._getTempStoreStartTag(presContentHtmlStr, secondLastIndex);
		if ( tempStore){
			finalIndex = tempStore.index;
		} else {
			tagRegexp.lastIndex = secondLastIndex;
			var match = tagRegexp.exec(presContentHtmlStr);
			if (match != null) {
				finalIndex = match.index;
			}
		}
		return finalIndex;
	},
	
	_getTempStoreStartTag: function ( presContentHtmlStr, index){
		var tagRegexp =/<\s*div[^<]*\s*id=['"]tempStore['"].*?>/ig;
		tagRegexp.lastIndex = index;
		var match = tagRegexp.exec(presContentHtmlStr);
		if ( match){
	        var nodeText = match[0];
	        return { text: nodeText,
	                index: match.index };
	    }
	},
	
	_getHeadTag: function ( presContentHtmlStr){
		var tagRegexp =/<\/*head[^<]*>/ig;
		var startIndex = null;
		var endIndex = null;
		var endTag = null;
		tagRegexp.lastIndex = 0;
	    var match = tagRegexp.exec( presContentHtmlStr);
	    if ( match){
	    	startIndex = match.index;
	    }
	    match = tagRegexp.exec( presContentHtmlStr);
	    if ( match){
	    	endTag = match[0];
	    	endIndex = match.index;
	    }
	    if ( startIndex && endIndex){
	    	var head = presContentHtmlStr.substring( startIndex, endIndex + endTag.length);
	    	head = this._getListBeforeStyleTag(head);

	    	// to ensure that these two css files can be loaded, to avoid cache in browser
	    	var head1 = head.replace("office_automatic_styles.css", "office_automatic_styles.css?preventCache="+Math.random());	
	    	var head2 = head1.replace("office_styles.css", "office_styles.css?preventCache="+Math.random());
	    	return head2;
	    }	    
	    return null;
	},
	_getListBeforeStyleTag: function ( headHtmlStr){
    	pe.scene.slideSorter.listBeforeStyleStack = {};
    	pe.scene.slideSorter.newlistBeforeStyleStack = {};
    	pe.scene.slideSorter.deletelistBeforeStyleStack = [];
		var tagRegexp =/<\/*style[^<]*stylename=['"]list_before_style['"][^<]*<\/style>/ig;
		var contentagRegexp =/<\/*style[^<]*stylename=['"]list_before_style['"][^<]*>/ig;
	    var match = tagRegexp.exec( headHtmlStr);
	    if (match){
	    	try{
	    		var listBeforeStyleStr = match[0];
		    	//headHtmlStr = headHtmlStr.replace(listBeforeStyleStr,'');
		    	var matchContent = contentagRegexp.exec( listBeforeStyleStr);
				var listBeforeStyleContentStr = matchContent[0];
				listBeforeStyleContentStr = listBeforeStyleStr.substring( listBeforeStyleContentStr.length,listBeforeStyleStr.length-'</style>'.length);
				var items=listBeforeStyleContentStr.split('.IL_CS_');
				for(var i=1;i<items.length;i++){
					var txtContent = '.IL_CS_'+items[i].trim();
					var name = txtContent.substr(1,txtContent.indexOf(':before')-1);
					var tmpstart = txtContent.indexOf('{');
					var tmpend = txtContent.indexOf('}');
					var theValuetext = txtContent.substring(tmpstart+1,tmpend);
					pe.scene.slideSorter.listBeforeStyleStack[name] = theValuetext;
				}
	    	}catch(evt){
	    		console.log("==============>error when deal list style css sheet!!!");
	    	}
			
	    	return headHtmlStr;
	    }
	    return headHtmlStr;
	},
