	_isTaskBetweenCurrentAndNext: function( currentTag, nextTag, index){
		if ( currentTag && nextTag && currentTag.index < index &&
				nextTag.index > index){
			return true;
		}
		return false;
	},
	
	_deleteLastDiv: function ( htmlString){
		return htmlString.replace( /<\/*div\s*>\s*$/, '');
	},	
	
	_deleteLastThreeDivs: function ( htmlString){
		return htmlString.replace( /<\/*div\s*>\s*<\/*div\s*>\s*<\/*div\s*>\s*$/, '');
	},
	_getTempStoreContent: function(presContentHtmlStr, index){
		if(index == null){
			index = 0;
		}
		var tempStoreStartTag = this._getTempStoreStartTag( presContentHtmlStr, index);
		if(tempStoreStartTag!=null){
			var endBodyIdx = this._getEndBodyTagIndex(presContentHtmlStr, index);
			if(endBodyIdx>=0){
				var tempStoreContent = presContentHtmlStr.substring(tempStoreStartTag.index, endBodyIdx);
				return tempStoreContent;
			}
		}
		return "";
	}
